import './styles.css';
import img1 from "./images/logo_1.png";

export const ACTIONS = {
  ADD_DIGIT: "add-digit",
  CHOOSE_OPERATION: "choose-operation",
  CLEAR: "clear",
  DELETE_DIGIT: "delete-digit",
  EVALUATE: "evaluate",
}

function App() {
  return (
    <div className="grid-container">
      <div className="logo grid-item-1">
        <img className="logo-image" scr={img1} alt="Traveling Piano Logo" />
      </div>
      <div className="grid-item grid-item-2">test</div>
      <div className="grid-item grid-item-3">test</div>
      <div className="grid-item grid-item-4">test</div>
      <div className="grid-item grid-item-5">test</div>
      <div className="grid-item grid-item-6">test</div>
    </div>
  );
}

export default App;
